import data from "../custom_data/image_search.json";

export default class LocalJson extends Component {
	render() {
		return (
			<>
				<Container fluid={true}>
					<Row>
						<CardDeck className=" no-gutters ">
							{data.map((postData) => {
								console.log(postData);
								return (
									<Card key={postData.id}>
										<Card.Img variant="top" src={postData.image} />
										<Card.Body>
											<Card.Title className={style.tile}>
												{postData.title}
											</Card.Title>
											<Card.Subtitle className={style.tag}>
												{postData.tag + " "}
											</Card.Subtitle>

											<Card.Text className={style.para}>
												{postData.body}
											</Card.Text>
										</Card.Body>
									</Card>
								);
							})}
						</CardDeck>
					</Row>
				</Container>
			</>
		);
	}
}
